import { useState, useEffect } from 'react';
import axios from 'axios';
import { useContext } from 'react';
import { AuthContext } from '../App';

function AdminDashboard() {
  const { token } = useContext(AuthContext);
  const [orderCount, setOrderCount] = useState(0);
  const [users, setUsers] = useState([]);
  const [products, setProducts] = useState([]);
  const [newProduct, setNewProduct] = useState({ name: '', price: '', image: '', category: '' });
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      if (!token) {
        setError('No authentication token');
        return;
      }
      try {
        const [ordersRes, usersRes, productsRes] = await Promise.all([
          axios.get('http://localhost:5001/api/admin/orders/count', { headers: { Authorization: `Bearer ${token}` } }),
          axios.get('http://localhost:5001/api/admin/users', { headers: { Authorization: `Bearer ${token}` } }),
          axios.get('http://localhost:5001/api/admin/products', { headers: { Authorization: `Bearer ${token}` } }),
        ]);
        setOrderCount(ordersRes.data.count || 0);
        setUsers(Array.isArray(usersRes.data) ? usersRes.data : []);
        setProducts(Array.isArray(productsRes.data) ? productsRes.data : []);
      } catch (err) {
        setError('Failed to load data');
        console.error(err);
      }
    };
    fetchData();
  }, [token]);

  const handleDeleteUser = async (id) => {
    if (window.confirm('Are you sure you want to delete this user?')) {
      try {
        await axios.delete(`http://localhost:5001/api/admin/users/${id}`, { headers: { Authorization: `Bearer ${token}` } });
        setUsers(users.filter(user => user.id !== id));
      } catch (err) {
        setError('Failed to delete user');
        console.error(err);
      }
    }
  };

  const handleAddProduct = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5001/api/admin/products', newProduct, { headers: { Authorization: `Bearer ${token}` } });
      setProducts([...products, res.data]);
      setNewProduct({ name: '', price: '', image: '', category: '' });
    } catch (err) {
      setError('Failed to add product');
      console.error(err);
    }
  };

  const handleDeleteProduct = async (id) => {
    if (window.confirm('Are you sure you want to delete this product?')) {
      try {
        await axios.delete(`http://localhost:5001/api/admin/products/${id}`, { headers: { Authorization: `Bearer ${token}` } });
        setProducts(products.filter(product => product.id !== id));
      } catch (err) {
        setError('Failed to delete product');
        console.error(err);
      }
    }
  };

  if (error) return <div>{error}</div>;

  return (
    <div>
      <h2>Admin Dashboard</h2>
      <p>Total Orders: {orderCount}</p>
      <h3>Users</h3>
      <ul>
        {Array.isArray(users) && users.map(user => (
          <li key={user.id}>
            {user.email} (Admin: {user.is_admin ? 'Yes' : 'No'}) <button onClick={() => handleDeleteUser(user.id)}>Delete</button>
          </li>
        ))}
      </ul>
      <h3>Products</h3>
      <ul>
        {Array.isArray(products) && products.map(product => (
          <li key={product.id}>
            {product.name} - ₹{product.price} <button onClick={() => handleDeleteProduct(product.id)}>Delete</button>
          </li>
        ))}
      </ul>
      <h3>Add New Product</h3>
      <form onSubmit={handleAddProduct}>
        <div>
          <label>Name:</label>
          <input type="text" value={newProduct.name} onChange={(e) => setNewProduct({ ...newProduct, name: e.target.value })} required />
        </div>
        <div>
          <label>Price:</label>
          <input type="number" step="0.01" value={newProduct.price} onChange={(e) => setNewProduct({ ...newProduct, price: e.target.value })} required />
        </div>
        <div>
          <label>Image URL:</label>
          <input type="text" value={newProduct.image} onChange={(e) => setNewProduct({ ...newProduct, image: e.target.value })} required />
        </div>
        <div>
          <label>Category:</label>
          <input type="text" value={newProduct.category} onChange={(e) => setNewProduct({ ...newProduct, category: e.target.value })} required />
        </div>
        <button type="submit">Add Product</button>
      </form>
    </div>
  );
}

export default AdminDashboard;
